import {Fragment} from'react'
import NavBar from './Components/UI/NavBar'
import TodoList from './TO-DO/TodoList';




function App() {

  const todos = [

    {
      id: Math.random() + 1,
      activity :"need to go to school"

    },

    {
      id: Math.random() + 7,
      activity :"Do homework"

    },

    {
      id: Math.random() + 9,
      activity :"go outside and play"

    }

  ]
  return (
   <Fragment>
     <header>
     <NavBar />
     </header>

     <TodoList todos={todos}/>

   </Fragment>
  );
}

export default App;
